By the way, kami mendukung pengesahan RUU TPKS dan Permendikbud 30/2021.

@irzan_wiratama @bnababan @VICE_ID Apanya yang "jelas"?

Tidak juga. Beberapa mutual akun ini ada yang mengkritik regulasi tersebut juga, walaupun memang tidak seramai penolakan terhadap RUU TPKS dan Permendikbud 30/2021. Tidak bisa disangkal, faktor politik memengaruhi.

Tapi, tidak bisa digeneralisasi juga.
